import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import clsx from "clsx";
import { listStateDetails } from "../actions/stateActions";
import {
  Button,
  makeStyles,
  Card,
  CardHeader,
  CardMedia,
  CardContent,
  CardActions,
  Collapse,
  Avatar,
  IconButton,
  Typography,
  CircularProgress,
} from "@material-ui/core";
import { red } from "@material-ui/core/colors";
import { FavoriteIcon, ShareIcon } from "@material-ui/icons";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";
import MoreVertIcon from "@material-ui/icons/MoreVert";
import axios from "axios";

import { listStates } from "../actions/stateActions";
import MuiAlert from "@material-ui/lab/Alert";

const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 800,
    background: "rgba(0,0,0,0.5)",
    width: "80%",
    height: "auto",
    justifyContent: "center",
    alignItems: "center",
    marginLeft: "10%",
    marginRight: "10%",
  },
  media: {
    height: 440,
    paddingTop: "56.25%", // 16:9
  },
  expand: {
    transform: "rotate(0deg)",
    marginLeft: "auto",
    transition: theme.transitions.create("transform", {
      duration: theme.transitions.duration.shortest,
    }),
  },
  expandOpen: {
    transform: "rotate(180deg)",
  },
  avatar: {
    backgroundColor: red[500],
  },
  button: {
    display: "flex",
    marginLeft: "10%",
    marginTop: ".5rem",
    marginBottom: ".5rem",
    justifyContent: "flex-end",
  },
}));

const ProductScreen = ({ match }) => {
  const classes = useStyles();
  const dispatch = useDispatch();
  const stateDetials = useSelector((state) => state.stateDetials);
  const { loading, error, state } = stateDetials;
  const [expanded, setExpanded] = React.useState(false);

  const handleExpandClick = () => {
    setExpanded(!expanded);
  };

  useEffect(() => {
    // console.log(match.params.id);
    dispatch(listStateDetails(match.params.id));
    // }, [dispatch, match]);
  }, []);

  return (
    <>
      {loading ? (
        <CircularProgress />
      ) : error ? (
        <MuiAlert severity="error">{error}!</MuiAlert>
      ) : (
        <div>
          <Link
            to={`/`}
            style={{ color: "inherit", textDecoration: "inherit" }}
          >
            <Button
              variant="outlined"
              color="primary"
              size="small"
              className={classes.button}
            >
              Go back
            </Button>
          </Link>
          <Card className={classes.root}>
            <CardHeader
              avatar={
                <Avatar aria-label="recipe" className={classes.avatar}>
                  KA
                </Avatar>
              }
              action={
                <IconButton aria-label="settings">
                  <MoreVertIcon />
                </IconButton>
              }
              // title={state.name}
            />
            <CardMedia
              // className={classes.media}
              // image={product.image}
              // title={product.name}
              component="img"
              alt="Contemplative Reptile"
              // height="140"
              src={state.image}
              title={state.name}
            />
            <CardContent>
              <Typography variant="body2" color="textSecondary" component="p">
                {state.description}
              </Typography>
            </CardContent>
            <CardActions disableSpacing>
              <IconButton
                className={clsx(classes.expand, {
                  [classes.expandOpen]: expanded,
                })}
                onClick={handleExpandClick}
                aria-expanded={expanded}
                aria-label="show more"
              >
                <ExpandMoreIcon />
              </IconButton>
            </CardActions>
            <Collapse in={expanded} timeout="auto" unmountOnExit>
              <CardContent>
                <Typography paragraph>Method:</Typography>
                <Typography paragraph>{state.description}</Typography>
                <Typography paragraph>{state.description}</Typography>
                <Typography paragraph>{state.description}</Typography>
                <Typography>{state.description}</Typography>
              </CardContent>
            </Collapse>
          </Card>
        </div>
      )}
    </>
  );
};

export default ProductScreen;
